function getData(db, id) {
    return new Promise((resolve, reject) => {
        const transaction = db.transaction('sharedData', 'readonly');
        const store = transaction.objectStore('sharedData');

        const request = store.get(id);

        request.onsuccess = (event) => {
          resolve(event.target.result);
        };

        request.onerror = (event) => {
          reject(event.target.error);
        };
    });
}
function openDatabase() {
    return new Promise((resolve, reject) => {
        const request = indexedDB.open('shareTargetDB', 1);

        request.onupgradeneeded = (event) => {
            const db = event.target.result;
            db.createObjectStore('sharedData', { keyPath: 'id' });
        };

        request.onsuccess = (event) => {
            resolve(event.target.result);
        };

        request.onerror = (event) => {
            reject(event.target.error);
        };
    });
}

function super_pwa_attach_share_target(base64String){
    var ajax_url = pwa_share_target.ajax_url;
    var pwaforwp_security_nonce = pwa_share_target.pwaforwp_security_nonce;
    var binaryString = atob(base64String.split(',')[1]);

        // Create a Uint8Array from the binary string
    var len = binaryString.length;
    var bytes = new Uint8Array(len);
    for (var i = 0; i < len; i++) {
        bytes[i] = binaryString.charCodeAt(i);
    }
    var blob = new Blob([bytes], { type: 'image/png' });
    console.log(blob)
    var url = URL.createObjectURL(blob);
    var formData = new FormData()
    formData.append('action', 'superpwa_add_media')
    formData.append('pwaforwp_security_nonce', pwaforwp_security_nonce)
    formData.append('component', 'members')
    formData.append('context', 'activity')
    formData.append('_mpp_file', blob, "test.png")
    jQuery.ajax({
        type: "POST",    
        url:ajax_url,                    
        dataType: "json",
        data:formData,
        processData: false,
        contentType: false,
        success:function(response){
            console.log(response.data)
            var new_html = `<li class="mpp-uploaded-media-item" id="mpp-uploaded-media-item-`+response.data.id+`" data-media-id="`+response.data.id+`">
            <img src="`+response.data.url+`">
            <a href="#" class="mpp-delete-uploaded-media-item">x</a></li>`;

            console.log(new_html)
            jQuery("#mpp-uploaded-media-list-activity" ).find('li:last').after( new_html );
            jQuery('body').data('mpp-attached-media',response.data.id);                
            // setTimeout(function(){ location.reload(); }, 1000);
        },
        error: function(response){                    
        console.log(response);
        }
    });
}

function superpwa_start_attache(binary_image) {
    console.log('in setTimeout');
    if (document.getElementById("mpp-activity-upload-buttons")) {
        document.getElementById("mpp-photo-upload").click();
        super_pwa_attach_share_target(binary_image)
    }else{
        console.log('content not load yet');
    }
}

async function getCachedData(cacheName, url) {
    const cacheStorage = await caches.open(cacheName);
    const cachedResponse = await cacheStorage.match(url);
  
    if (!cachedResponse || !cachedResponse.ok) {
      return false;
    }
  
    return await cachedResponse.json();
  }

